import React from "react";
import "./ColorPick.css";

const ColorPick = () => {
  const onChangeColor = (colorID) => {
    if (colorID == 1) {
      alert(colorID);
    } else if (colorID == 2) {
      alert(colorID);
    } else if (colorID == 3) {
      alert(colorID);
    } else if (colorID == 4) {
      alert(colorID);
    }
  };
  return (
    <table className="ColorTable">
      <tbody>
        <tr>
          <td>
            <div className="blueTemplate" onClick={onChangeColor()}></div>
          </td>
          <td>
            <div className="purpleTemplate"></div>
          </td>
          <td>
            <div className="greenTemplate"></div>
          </td>
          <td>
            <div className="grayTemplate"></div>
          </td>
        </tr>
      </tbody>
    </table>
  );
};

export default ColorPick;
